import React from "react";

function Microcontroladores() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Microcontroladores</h1>
      <p>
        Bienvenido a la sección de Microcontroladores. Aquí encontrarás placas y chips para tus proyectos electrónicos.
      </p>
      {/* Aquí luego renderizaremos productos desde el backend */}
    </div>
  );
}

export default Microcontroladores;
